//import from './logo.svg';
import './App.css';
import StorefrontIcon from "@mui/icons-material/Storefront";
import SearchIcon from "@mui/icons-material/Search";
import ShoppingBasketIcon from "@mui/icons-material/ShoppingBasket";

function App() {
  return (
    <div className="App">
      <div className='header_logo'>
      <StorefrontIcon className='header_logoImage' fontSize='large'/>
      <h2>eShop</h2>
      </div>


<div className='temporary'></div>
<div className='header_search'>

  <input />
<SearchIcon />

</div>

<div className='header_nav'>
<div className='nav_item'>
<span className='nav-itemLineOne'>Hello Guest</span>
<span className='nav_itemLineTwo'>Sign In</span>
  </div>
  <div className='nav_item'>
<span className='nav-itemLineOne'>Your</span>
<span className='nav_itemLineTwo'>Shop</span>
</div>

<div className='nav_item'>
<ShoppingBasketIcon fontSize='large'/>
<span className='nav-itemLineOne'>Basket</span>
<span className='nav_itemLineTwo'>0</span>
</div>
</div>



  </div>
  )
}


export default App;
